import React, { Component } from 'react';

export default class About extends Component {
  render() {
    return (
      <div className='about'>
        <ul className='about_menu'>
          <li className='about_menu_item'>Home</li>
          <li className='about_menu_item'>About</li>
          <li className='about_menu_item'>Shop</li>
          <li className='about_menu_item'>Contact</li>
        </ul>
      </div>
    );
  }
}
